  x_array = []
  for g, j in enumerate(x_arr):
    print("x{}: {} => f({}): {}".format(g, j, j, f_arr[g]))

  min,middle,max = sort_function(x_arr, f_arr)

  temp = [alpha[i], N[i], x_0, x_1, x_2]
  simplex_function(min, middle, max, n, M, alpha[i], N[i])
